import './App.css';

function App() {
  return (
    <div className="App">
      <img src="images/cube.jpg" alt="" />

      <ul>
        <li key='list-01'>Home</li>
        <li key='list-A'>/</li>
        <li key='list-02'>About Me</li>
        <li key='list-B'>/</li>
        <li key='list-03'>Projects</li>
      </ul>
    </div>
  );
}

export default App;
